import React from "react";

function App() {
  let count = 0;

  function increment(){
    count+=1;
    console.log(count);
  }

  function decrement(){
    count--;
    console.log(count);
  }

  return (
    <div className="App">
      <h1>{count}</h1>
      <button onClick={increment}>Increment</button>
      <button onClick={decrement}>Decremect</button>
    </div>
  );
}

export default App;
